# This file defines some simple functions for the compiler and then attempts to run them
# Run this file using "jruby -C" to test the compiler

FIB30000 = 


def fib_java(n)
	if n < 2
	  n
	else
	  fib_java(n - 2) + fib_java(n - 1)
	end
end

def fib_iter_java(n)
   i = 0
   j = 1
   cur = 1
   while cur <= n
     k = i
     i = j
     j = k + j
     cur = 1 + cur
   end
   i
end

def run1
  fib = 34
  before = Time.new
  fib_java(fib)
  after = Time.new
  p "fib(#{fib}) took #{after-before} s"
end

def run2
  fib = 300000
  before = Time.new
  val = fib_iter_java(fib)
  after = Time.new
  p "fib(#{fib}) took #{after-before} s"
  if val == FIB30000 
    p "OK"
  else 
    p val
  end
end


